import axios from 'axios';
import { QA, QACreate } from '../types/qaTypes';

const API_URL = 'http://localhost:8000/qa';

export const submitQA = async (qaData: QACreate): Promise<QA> => {
  // This would typically require a token
  const response = await axios.post(API_URL, qaData);
  return response.data;
};

export const getQA = async (): Promise<QA> => {
  // This would typically require a token
  const response = await axios.get(API_URL);
  return response.data;
};
